import Box from '@mui/material/Box';
export default function Profile(){
    return (
        <div>
            <Box id="profilePage">
                <Box id="profile-head">

                </Box>
                <Box id="profile-setting">
                    <Box id="profile-name"></Box>
                    <Box id="profile-age"></Box>
                    <Box id="profile-gender"></Box>
                    <Box id="profile-email"></Box>
                    <Box id="profile-statement"></Box>
                </Box>
            </Box>
        </div>
    );
}
